// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./Admin.sol";
import "./Utils.sol";

contract MRO {
    Admin public admin;
    mapping(address => bool) public isMRO;

    event MRORegistered(address indexed mro);
    event PartStatusUpdated(uint indexed partId, Utils.PartStatus status);

    modifier onlyAdmin() {
        require(admin.isAdmin(msg.sender), "Only admin can call this function");
        _;
    }

    modifier onlyMRO() {
        require(isMRO[msg.sender], "Only registered MROs can call this function");
        _;
    }

    constructor(address _admin) {
        require(_admin != address(0), "Admin address cannot be zero");
        admin = Admin(_admin);
    }

    function registerMRO(address _mro) external onlyAdmin {
        require(_mro != address(0), "MRO address cannot be zero");
        require(!isMRO[_mro], "MRO already registered");
        isMRO[_mro] = true;
        emit MRORegistered(_mro);
    }

    function createServiceOrder(string memory _aircraftId, string memory _description) external onlyMRO {
        admin.createServiceOrder(_aircraftId, _description);
    }

    function updatePartStatus(uint _partId, Utils.PartStatus _status) external onlyMRO {
        admin.updatePartStatus(_partId, _status);
        emit PartStatusUpdated(_partId, _status);
    }

    function getServiceOrders() external view returns (Utils.ServiceOrder[] memory) {
        return admin.getServiceOrders();
    }

    function getParts() external view returns (Utils.Part[] memory) {
        return admin.getParts();
    }
}
